import React from 'react';

const ImageLinkForm = () => {
    return (
        <div className='ma4 mt0'>
            <Tilt className="Tilt br 2 shadow-2 pointer" options={{ max : 55 }} style={{ height: 150, width: 250 }} >
                <div className="Tilt-inner pa3"> 
                    <img style={{paddingTop: '5px'}} alt='brain-log' src={brain} /> 
                </div>
            </Tilt>

        </div>
    );
}

export default ImageLinkForm;
